import { ContentPage } from '../styled/Components';

/** @function Home 
* @returns The home page of the user 
* */
const Home = () => {
	return (
		<ContentPage title="Home">
			<PersonalInfo />
		</ContentPage>
	);
}

const PersonalInfo = (props: any) => {
	return (
		<div>THis is the personal info of the student.</div>
	);
}

export default Home;
